import React from 'react';
import logo from './logo.svg';
import './App.css';
import Axios from 'axios'

function App() {
  const query = {
    query: {
      match: {
        "company_name": "Docuprint"
      }
    }
  };
  xios.get('http://localhost:9200/company_test/_search', {
      data: JSON.stringify(query),
  }).then((res) => {
      console.log(res);
  });

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>

        </p>
      </header>
    </div>
  );
}

export default App;
